    { name: 'Rena', age: '26' },
  ];
  return (
    <div className='App'>
      <h1>hi i am react</h1>
      <button>Switch Name</button>
      <Person name={persons[0].name} />
      <Person name={persons[1].name} />
      <Person name={persons[2].name}>i am a programmer</Person>
    </div>
  );
}

export default App;
